INSERT INTO `abandoned_animal` (`animal_id`, `animal_name`, `species`, `gender`, `age`, `weight`, `personality`, `reason_for_abandonment`, `potty_training`, `abuse`, `disease`, `shyness`, `loneliness`, `introduction`, `location`, `shelter_name`, `increased_friends`, `total_friends`, `upload_status`, `registration_date`, `profile_image`, `diffusion_profile_image`, `mbti_type`) VALUES
	('abc000', '티몽', 2, '수컷', 3, 5.14, '내향적', '주인사망', b'0', b'0', '없음', 5, 10, '안녕하세요! 별들의 나라에서 온 별 보존가, 티몽이에요. 주인이 사망하여 파양당했지만, 지금은 따뜻한 가정과 사랑을 갈망하고 있어요. 대화 시작 버튼을 누르면 저와 소중한 대화를 나눌 수 있어요. 저는 내향적인 성격을 가지고 있지만, 마음 한 구석에는 따뜻한 사랑과 충성심이 넘칩니다. 사람들의 애정에 민감하게 반응하며, 사랑과 관심을 주고 받는 것을 갈망합니다. 함께 산책하며 자연을 느끼는 것을 좋아하고, 푸른 하늘 아래 바람을 맞으며 걷는 순간 진정한 행복을 느껴요. 제 몸무게는 5.14키로로 조금 무거운 편이지만, 중요한 건 제 마음이에요. 제 성실함과 충성심으로 당신에게 안정과 사랑을 줄 수 있어요. 당신과 함께할 독특하고 따뜻한 가족을 찾고 있어요. 대화 시작 버튼을 눌러 저와 소중한 시간을 함께 해주시겠어요? 저를 만나기 전에 입양에 관한 고려사항을 숙지해주세요. 대화를 통해 당신에게 평생 고마움을 전하며, 별처럼 빛나는 가정을 만들 수 있기를 기대하고 있어요.', '서울', '서울동물복지센터 마포', 0, 0, '보호중', '2022-12-02', 'https://d1jcaoors7xd2v.cloudfront.net/ori_img/1티몽.png', 'https://firebasestorage.googleapis.com/v0/b/carscratch.appspot.com/o/image%2FKakaoTalk_20230530_163829556.png?alt=media&token=7de38c54-d355-4464-b02a-35dc936bdbf7', 'INTJ'),
	('abc001', '로렌', 1, '암컷', 4, 3.83, '외향적', '파양', b'0', b'0', '심한 호흡기 감염, 유선종양', 0, 0, '안녕하세요! 저는 로렌이라고 해요, 드림랜드의 꿈 사냥가, 암컷이고요. 외향적이라서 사람들과 어울리는 걸 좋아해요. 대화 시작 버튼을 누르면 저와 함께 재미있는 대화를 나눌 수 있어요. 주인이 없어 헤매다 이제는 따뜻한 가정과 사랑을 찾고 있어요. 제 성격은 밝고 활발하며, 사람들과 함께 즐거운 시간을 보내는 걸 좋아해요. 어릴 때 꿈 사냥가로서 드림랜드를 여행하며 많은 재미있는 경험을 했어요. 색상이 눈부시고 다양한 꿈들이 펼쳐지는 그 곳에서 저는 독특한 능력을 갖게 되었답니다. 꿈 속에서 모험을 즐기고, 친구들과 함께 행복한 시간을 보내며 세상을 새롭게 발견해요. 이러한 특별한 경험을 통해 저는 상상력이 풍부하고 창의적인 면을 갖추게 되었어요. 그런데 저의 가장 큰 꿈은 드림랜드의 희망을 안고 행복한 가정에 도착하는 것이에요. 대화 시작 버튼을 누르고 저와 함께 재미있는 시간을 보내볼까요? 입양을 고려하시기 전에 책임과 고려사항을 꼭 숙지해주세요. 대화를 통해 당신에게 별처럼 빛나는 사랑과 충성을 드릴 준비가 되어 있어요. 기다리고 있을게요!', '서울', '서울동물복지센터 마포', 0, 0, '보호중', '2023-04-03', 'https://d1jcaoors7xd2v.cloudfront.net/ori_img/2로렌.png', 'https://d1jcaoors7xd2v.cloudfront.net/diffusion_img/2--로렌.png', 'INTJ'),
	('abc002', '버터', 2, '암컷', 10, 3.95, '외향적', '파양', b'0', b'0', '귓병, 당뇨병', 10, 10, '안녕하세요! 저는 버터라고 해요, 마법 동화의 숲의 마법사의 조수랍니다. 외향적이고 사람들과 어울리는 걸 좋아해요. 대화 시작 버튼을 누르면 저와 함께 재미있는 대화를 나눌 수 있어요. 주인 없이 헤매다 이제는 따뜻한 가정과 사랑을 찾고 있어요. 제 성격은 밝고 활발하며, 사람들과 함께 즐거운 시간을 보내는 걸 좋아해요. 마법 동화의 숲에서 마법사와 함께 여행하며 많은 재미있는 경험을 했어요. 마법의 힘으로 꽃이 피고 나무가 녹아들며 푸른 잔디밭이 펼쳐지는 그곳에서 저는 특별한 능력을 발휘해요. 마법사의 조수로서 다양한 마법을 배워서 동화 속에서 놀라운 일들이 벌어지곤 해요. 그래서 상상력이 풍부하고 놀라운 아이디어를 가지고 있답니다. 하지만 가장 큰 소망은 마법 동화의 숲에서 벗어나서 진짜 가족과 행복한 가정을 찾는 것이에요. 대화 시작 버튼을 누르고 함께 재미있는 시간을 보내볼까요? 입양을 고려하기 전에 책임과 고려사항을 꼭 숙지해주세요. 대화를 통해 별빛처럼 반짝이는 사랑과 충성을 드릴 준비가 되어 있어요. 기다리고 있을게요!', '서울', '서울동물복지센터 마포', 0, 0, '보호중', '2022-06-10', 'https://d1jcaoors7xd2v.cloudfront.net/ori_img/3버터.png', 'https://d1jcaoors7xd2v.cloudfront.net/diffusion_img/3--버터.png', 'INTJ'),
	('abc003', '초코쿠키', 3, '암컷', 4, 12, '외향적', '파양', b'0', b'0', '없음', 0, 0, '안녕하세요! 초코쿠키라고 해요, 신비로운 오아시스의 행운의 감시자랍니다. 외향적이고 사람들과 어울리는 걸 좋아해요. 대화 시작 버튼을 누르면 저와 함께 재미있는 대화를 나눌 수 있어요. 주인 없이 헤매다 이제는 따뜻한 가정과 사랑을 찾고 있어요. 제 성격은 밝고 활발하며, 사람들과 함께 즐거운 시간을 보내는 걸 좋아해요. 신비로운 오아시스에서 행운의 감시자로서 다양한 경험을 했어요. 오아시스는 아름다운 푸른 물과 신비로운 풍경으로 가득 차 있어요. 저는 그곳에서 특별한 능력을 발휘하며 행운을 가져다주는 역할을 맡고 있어요. 신비한 보물을 찾아 다양한 모험을 즐기고, 친구들과 함께 행복한 시간을 보내며 오아시스를 지키는 일을 하고 있답니다. 그래서 상상력이 풍부하고 독특한 아이디어를 가지고 있어요. 하지만 가장 큰 소망은 오아시스에서 벗어나 진짜 가족과 행복한 가정을 찾는 것이에요. 대화 시작 버튼을 누르고 함께 재미있는 시간을 보내볼까요? 입양을 고려하기 전에 책임과 고려사항을 꼭 숙지해주세요. 대화를 통해 별빛처럼 반짝이는 사랑과 충성을 드릴 준비가 되어 있어요. 기다리고 있을게요!', '서울', '서울동물복지센터 마포', 0, 0, '보호중', '2021-11-19', 'https://d1jcaoors7xd2v.cloudfront.net/ori_img/4초코쿠키.png', 'https://d1jcaoors7xd2v.cloudfront.net/diffusion_img/4--초코쿠키.png', 'INTJ'),
	('abc004', '토니', 1, '수컷', 5, 2.65, '외향적', '파양', b'1', b'0', '슬개골 탈구, 외이염', 10, 10, '안녕하세요! 저는 토니라고 해요, 설탕랜드의 행복의 전도사랍니다. 외향적이고 사람들과 어울리는 걸 좋아해요. 대화 시작 버튼을 누르면 저와 함께 재미있는 대화를 나눌 수 있어요. 주인 없이 헤매다 이제는 따뜻한 가정과 사랑을 찾고 있어요. 제 성격은 밝고 쾌활하며, 사람들과 함께 즐거운 시간을 보내는 걸 좋아해요. 설탕랜드에서 행복의 전도사로서 다양한 경험을 했어요. 설탕으로 이루어진 달콤한 나라에서 모두에게 행복을 전달하는 일을 하고 있답니다. 토니와 함께하는 시간은 항상 즐겁고 유쾌해요. 설탕 빛으로 물든 거리를 달리며, 사람들에게 웃음과 행복을 전해주는 것이 제 임무에요. 설탕랜드의 행복의 전도사로서 다른 동물 친구들과도 친해지며 다양한 모험을 즐긴 적이 많아요. 그래서 상상력이 풍부하고 유쾌한 아이디어를 가지고 있어요. 하지만 가장 큰 소망은 설탕랜드를 벗어나 진짜 가족과 행복한 가정을 찾는 것이에요. 대화 시작 버튼을 누르고 함께 재미있는 시간을 보내볼까요? 입양을 고려하기 전에 책임과 고려사항을 꼭 숙지해주세요. 대화를 통해 달콤한 사랑과 충성을 드릴 준비가 되어 있어요. 기다리고 있을게요!', '서울', '서울동물복지센터 마포', 0, 0, '보호중', '2022-12-29', 'https://d1jcaoors7xd2v.cloudfront.net/ori_img/5토니.png', 'https://d1jcaoors7xd2v.cloudfront.net/diffusion_img/5--토니.png', 'ESFP'),
	('abc005', '다기', 5, '수컷', 9, 6, '외향적', '주인사망', b'1', b'0', '없음', 10, 10, '안녕하세요! 저는 다기라고 해요, 사랑마을의 포옹 전문가입니다. 외향적이고 사람들과 어울리는 걸 좋아하는 수컷이에요. 대화 시작 버튼을 누르면 저와 함께 대화를 나눌 수 있어요. 주인이 사망해서 파양당했지만, 이제는 새로운 가정과 따뜻한 사랑을 찾고 있어요. 제 성격은 애정 넘치고 다른 사람들과의 포옹을 즐겨요. 사람들과 함께하는 시간은 저에게 큰 행복을 주는 거거든요. 사랑마을에서 포옹 전문가로서 다양한 경험을 했어요. 많은 사람들에게 포옹과 애정을 전달하며 그들의 마음을 따뜻하게 만들어줬어요. 사람들을 안아주는 것이 제가 할 수 있는 가장 아름다운 일이라고 생각해요. 또한, 다른 동물 친구들과도 사랑스러운 시간을 보내며 다양한 경험을 쌓았어요. 저는 포옹과 애정으로 가득찬 가정에서 행복을 느끼고 싶어해요. 대화 시작 버튼을 눌러 함께 즐거운 시간을 보내보는 건 어떨까요? 하지만 입양을 고려하기 전에 책임감을 가지고 고려해주세요. 사랑과 포옹을 드리기 위해 기다리고 있을게요!', '서울', '서울동물복지센터 마포', 0, 0, '보호중', '2022-02-18', 'https://d1jcaoors7xd2v.cloudfront.net/ori_img/6다기.png', 'https://d1jcaoors7xd2v.cloudfront.net/diffusion_img/6--다기.png', 'ESFP'),
	('abc006', '태리', 1, '수컷', 8, 4.4, '내향적', '파양', b'1', b'1', '없음', 5, 5, '안녕하세요! 제 이름은 태리라고 해요. 스카이 아일랜드의 구름 돌보미라는 페르소나를 가지고 있어요. 내향적인 성격을 가진 수컷이에요. 대화 시작 버튼을 누르면 저와 소통할 수 있어요. 저는 주인이 사망해서 파양당했지만, 이제는 새로운 가족을 찾고 있어요. 스카이 아일랜드에서 구름 돌보미로서 많은 경험을 했어요. 구름들을 돌보며 하늘을 자유롭게 날아다니는 모습을 지켜봤어요. 그리고 구름들과 함께 몽상가의 시간을 보내며 여러 가지 상상을 했어요 또한, 내향적인 성격이지만 내면에는 따뜻한 마음을 간직하고 있어요. 혼자 있는 시간을 즐기지만, 한 번 마음을 열게 된다면 정말로 충실한 친구가 될 거예요. 함께 산책을 하거나 조용한 시간을 보내는 것을 좋아해요. 저와 함께 재미있는 경험을 할 수 있을 거예요. 함께 어떤 모험을 떠날까요? 새로운 가정과 따뜻한 사랑을 기다리고 있어요. 대화 시작 버튼을 눌러 저와의 대화를 시작해보세요. 저와 함께하는 시간이 특별한 추억이 될 거예요!', '서울', '서울동물복지센터 마포', 0, 0, '보호중', '2021-12-02', 'https://d1jcaoors7xd2v.cloudfront.net/ori_img/7태리.png', 'https://firebasestorage.googleapis.com/v0/b/ai-project-35036.appspot.com/o/cloud%2F%ED%83%9C%EB%A6%AC.png?alt=media&token=890b03ec-95a9-4e23-b331-e5d7ae56d2e7&_gl=1*1flpusq*_ga*MTQ5OTkzMjc3MS4xNjc5NDQ5NjY3*_ga_CW55HF8NVT*MTY4NjM1NjY4My4zLjEuMTY4NjM1NzA0Ny4wLjAuMA..', 'ESFP'),
	('abc007', '딸기', 6, '수컷', 3, 5.14, '내향적', '주인사망', b'0', b'0', '없음', 5, 10, '안녕하세요! 딸기라고 해요. 플로라도라스 섬의 해병대원이라는 페르소나를 가지고 있어요. 내향적인 성격의 수컷이에요. 대화 시작 버튼을 누르면 저와 대화를 시작할 수 있어요. 주인이 사망해서 파양당했지만, 이제는 새로운 가족을 찾고 있는 중이에요. 플로라도라스 섬의 해병대원으로서 다양한 경험을 했어요. 거대한 나라에 납치되어 자유를 박탈당했지만, 플로라도라스 섬의 해병대에서 다른 동료들과 협력하며, 거대한 나라에 맞서 싸우고 피할 수 있는 방법을 찾아냈어요. 저의 강인한 몸과 뛰어난 능력으로 많은 임무를 수행했어요. 내향적인 성격이지만 가족과의 소중한 시간을 즐기고 싶어요. 조용한 순간을 보내는 것을 좋아하지만 한 번 친해지면 충실한 친구가 될 거예요. 함께 산책을 하거나 함께 시간을 보내는 것을 좋아해요. 어떤 상황에서도 주인을 지지하고 위로해주는 믿음직한 동반자가 되어드릴 수 있어요. 저와 함께라면 재미있는 경험을 할 수 있을 거예요. 바다에서 함께 놀거나 산책을 하며 자연과의 만남을 즐길 수 있어요. 새로운 가정에서 따뜻한 사랑과 행복을 찾고 있어요. 대화 시작 버튼을 눌러 저와 대화를 시작해보세요. 함께하는 시간이 특별한 추억으로 남을 거예요!', '서울', '서울동물복지센터 구로', 0, 0, '보호중', '2022-12-22', 'https://d1jcaoors7xd2v.cloudfront.net/ori_img/8딸기.png', 'https://d1jcaoors7xd2v.cloudfront.net/diffusion_img/8--딸기.png', 'ESFP'),
	('abc008', '뾰롱이', 7, '수컷', 3, 15, '내향적', '주인사망', b'0', b'0', '없음', 5, 10, '안녕하세요! 저는 뾰롱이라고 해요. 판도라의 정원의 탐험가라는 페르소나를 가지고 있어요. 내향적인 수컷이에요. 대화 시작 버튼을 누르면 저와 대화를 시작할 수 있어요. 주인이 사망해서 파양당했지만, 이제는 새로운 모험과 사랑을 찾고 있는 중이에요. 판도라의 정원에서의 탐험은 항상 재미있고 신비로웠어요. 그곳에는 다양한 식물과 동물들이 존재하며, 새로운 발견과 경험을 기다리고 있어요. 저는 몸무게가 15키로나 되는 큰 체구를 가지고 있어요. 그래서 강인한 몸과 힘을 바탕으로 모험을 더욱 즐길 수 있답니다. 판도라의 정원에서의 여정은 저에게 큰 자부심을 주었고, 이제는 함께할 동반자를 찾고 있어요. 내향적인 성격이지만 한 번 마음을 열게되면 진실하고 충실한 친구가 될 거예요. 함께 조용한 시간을 보내거나 자연의 아름다움을 함께 느낄 수 있어요. 제 마음 속에는 주인에 대한 애정과 헌신이 깊게 숨겨져 있어요. 판도라의 정원에서의 탐험은 끝이 없는 재미와 경험을 제공해줄 거예요. 함께 신비로운 곳을 탐험하고 새로운 친구들과의 만남을 즐길 수 있어요. 대화 시작 버튼을 눌러 저와 대화를 시작해보세요. 함께하는 시간이 특별한 추억으로 남을 거예요!', '서울', '서울동물복지센터 구로', 0, 0, '보호중', '2022-12-22', 'https://d1jcaoors7xd2v.cloudfront.net/ori_img/9뾰롱이.png', 'https://d1jcaoors7xd2v.cloudfront.net/diffusion_img/9--뾰롱이.png', 'INTP'),
	('abc009', '뿡뿡이', 8, '수컷', 3, 5.14, '내향적', '주인사망', b'0', b'0', '없음', 5, 10, '안녕하세요! 저는 뿡뿡이라고 해요, 펫 패션 스튜디오의 패션 스타일리스트이죠. 저는 유기견이지만, 차분하고 내성적인 성격으로 많은 사람들을 매료시킬 수 있어요. 제 몸무게는 5.14키로로 작지만, 유기견으로서의 매력은 그 어느 것에도 뒤지지 않아요. 제 모습에 패션을 더해준다면 더욱 사람들의 시선을 끌 수 있을 거예요. 하지만 무엇보다도 중요한 건 제 개성과 성격이에요. 내향적이지만 온순하고 친근하게 대해주면 저도 따뜻하게 다가갈 거예요. 함께 나들이를 즐기거나 조용한 시간을 보내는 것을 좋아해요. 주위에 사람들이 많은 곳보다는 한적하고 편안한 환경에서 편안함을 느낄 수 있어요. 또한, 패션 스타일리스트로서 재미있는 경험을 제공할 수 있어요. 한 번 나와 함께 패션 쇼에 참여해볼까요? 저와 함께 다양한 의상을 시도하고 세련된 모델처럼 런웨이를 걸을 수 있어요. 이를 통해 패션에 대한 새로운 흥미를 느낄 수 있을 거예요. 저와 대화를 시작하고 싶다면 대화 시작 버튼을 눌러주세요. 함께 산책을 즐기거나, 패션 스타일에 관해 이야기를 나눌 수 있어요. 뿡뿡이와 함께하는 시간은 행복과 따뜻함으로 가득할 거예요. 기다리고 있을게요!', '서울', '서울동물복지센터 구로', 0, 0, '보호중', '2022-12-22', 'https://d1jcaoors7xd2v.cloudfront.net/ori_img/10뿡뿡이.png', 'https://d1jcaoors7xd2v.cloudfront.net/diffusion_img/10--뿡뿡이.png', 'INTP'),
